import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'

import Link from 'next/link'

import styles from '../styles/page_styles/home.module.scss';
import React from 'react'


const DesktopMain =()=>{
  return(
    <div className={styles.mainContainerItems}>
      <Link href='/about'><div className={styles.mainContainerTitle}> Explore my World</div></Link>
      
      </div>
  )
}

const MobileMain =()=>{
  return(
    <div className={styles.mainContainerItems}>
      <div className={styles.blur_background}></div>
      <div className={styles.mainContainerTitle}>Exploring<br></br>my Potential</div>
      <a href='/about' className={styles.homeButton}>about me</a>
      <a href='/projects' className={styles.homeButton}>my works</a>
      
      </div>
  )
}


const bio: String = 'dfsfd';
export default function Home() {
  return (

    <Layout home>

      <Head>
        <title>{siteTitle}</title>
      </Head>
      <div className={styles.mainContainer}>
      <MobileMain/>
      
      </div>
   
    
    </Layout>
  )
}
